import React, { Component }from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';
import { Descriptions, List, Typography, Divider  } from 'antd';
import './dashboard.css'
import GlobalDaily from "../global-daily/global-daily";
import France from "../country-France/country-France";
const data = [
    ['Racing',99999999,"/France"],
    ['Japanese princess to wed commoner.',8888888888,"/France"],
    ['Australian walks 100km after outback crash.',7777777777,"/France"],
    ['Man charged over missing wedding girl.',66666666,"/France"],
    ['Los Angeles battles huge wildfires.',555555555,"/France"],
];
class Dashboard extends Component{
    render(): React.ReactNode {
        return(
            <List
                size="large"
                bordered
                itemLayout="horizontal"
                dataSource={data}
                style={{marginLeft:"30px"}}
                renderItem={item => <List.Item style={{width: "1000px", height: "auto"}}>
                    <div style={{width:"200px"}}>{item[0]}</div>
                    <div style={{width:"500px"}}>{item[1]}</div>
                    <Link to="/France">Link</Link>
                </List.Item>
                }>
                <Route exact path="/France" component={France} />
            </List>


        );
    }
}

export default Dashboard
